import styled from 'styled-components';

export const DrinkWrapper = styled.div`
  border: 1px solid #000;
  margin-right: 20px;
  width: 100px;
  height: 100px;
`;
export const Title = styled.div`
  border-bottom: 1px solid;
  width: 100px;
  height: 70px;
  margin: auto auto;
`;
export const Price = styled.div`
  width: 100px;
  height: 30px;
  display: flex;
  justify-content: center;
  align-items: center;
`;
